import { useState } from 'react';

export default function AnimatePresenceTable() {
  const [isHovered, setIsHovered] = useState(null);
  const [currentTheme, setCurrentTheme] = useState('light');

  const toggleTheme = () => {
    setCurrentTheme(currentTheme === 'light' ? 'dark' : 'light');
  };

  const properties = [
    { name: 'children', description: 'Les composants enfants à animer', type: 'ReactNode', default: 'required' },
    { name: 'custom', description: 'Valeurs personnalisées à passer aux animations', type: 'any', default: 'undefined' },
    { name: 'initial', description: 'Si les animations initiales doivent être exécutées', type: 'boolean', default: 'true' },
    { name: 'onExitComplete', description: 'Fonction appelée quand toutes les animations de sortie sont terminées', type: 'function', default: 'undefined' },
    { name: 'exitBeforeEnter', description: 'Attend que les animations de sortie soient terminées avant les animations d\'entrée', type: 'boolean', default: 'false' },
    { name: 'presenceAffectsLayout', description: 'Si la présence d\'un élément affecte la mise en page', type: 'boolean', default: 'true' }
  ];

  return (
    <div className={`p-6 max-w-full mx-auto rounded-lg shadow-lg ${currentTheme === 'dark' ? 'bg-gray-800 text-white' : 'bg-white text-gray-800'}`}>
      <div className="flex justify-between items-center mb-6">
        <h2 className="text-2xl font-bold">AnimatePresence - Framer Motion</h2>
        <button 
          onClick={toggleTheme} 
          className={`px-4 py-2 rounded-md ${currentTheme === 'dark' ? 'bg-gray-600 text-white' : 'bg-gray-200 text-gray-800'}`}
        >
          {currentTheme === 'dark' ? '☀️ Mode clair' : '🌙 Mode sombre'}
        </button>
      </div>
      
      <div className="mb-4">
        <p className="mb-2">
          <code className="font-mono bg-gray-100 dark:bg-gray-700 px-1 py-0.5 rounded">AnimatePresence</code> permet d&apos;animer les composants qui ont été retirés du DOM.
        </p>
      </div>

      <div className="overflow-x-auto">
        <table className="w-full border-collapse">
          <thead className={`${currentTheme === 'dark' ? 'bg-gray-700' : 'bg-gray-100'}`}>
            <tr>
              <th className="px-4 py-3 text-left font-semibold border-b">Propriété</th>
              <th className="px-4 py-3 text-left font-semibold border-b">Description</th>
              <th className="px-4 py-3 text-left font-semibold border-b">Type</th>
              <th className="px-4 py-3 text-left font-semibold border-b">Défaut</th>
            </tr>
          </thead>
          <tbody>
            {properties.map((prop, index) => (
              <tr 
                key={prop.name}
                onMouseEnter={() => setIsHovered(index)}
                onMouseLeave={() => setIsHovered(null)}
                className={`transition-colors duration-200 ${isHovered === index ? (currentTheme === 'dark' ? 'bg-gray-700' : 'bg-gray-50') : ''} ${currentTheme === 'dark' ? 'hover:bg-gray-700' : 'hover:bg-gray-50'} ${index % 2 === 0 ? (currentTheme === 'dark' ? 'bg-gray-800' : 'bg-white') : (currentTheme === 'dark' ? 'bg-gray-900' : 'bg-gray-50')}`}
              >
                <td className="px-4 py-3 border-b font-mono text-sm">
                  <span className={`${currentTheme === 'dark' ? 'text-blue-300' : 'text-blue-600'}`}>{prop.name}</span>
                </td>
                <td className="px-4 py-3 border-b">{prop.description}</td>
                <td className="px-4 py-3 border-b font-mono text-sm">
                  <span className={`${currentTheme === 'dark' ? 'text-green-300' : 'text-green-600'}`}>{prop.type}</span>
                </td>
                <td className="px-4 py-3 border-b font-mono text-sm">
                  <span className={`${currentTheme === 'dark' ? 'text-purple-300' : 'text-purple-600'}`}>{prop.default}</span>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div className="mt-6 p-4 rounded border border-gray-300 dark:border-gray-600">
        <h3 className="font-bold mb-2">Exemple d&apos;utilisation:</h3>
        <pre className={`p-3 rounded overflow-x-auto ${currentTheme === 'dark' ? 'bg-gray-900' : 'bg-gray-100'}`}>
          <code className="font-mono text-sm whitespace-pre">
{`import { motion, AnimatePresence } from 'framer-motion'

export const Items = ({ items }) => (
  <AnimatePresence>
    {items.map(item => (
      <motion.div
        key={item.id}
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        exit={{ opacity: 0 }}
      />
    ))}
  </AnimatePresence>
)`}
          </code>
        </pre>
      </div>
    </div>
  );
}
